package java214;

public class NonPrimitivetoPrimitive {

		public static void main(java.lang.String[] args) {
			// TODO Auto-generated method stub
			
			//integer
			
	String str1="123";

	int number1=Integer.valueOf(str1);

	System.out.println(number1);


	//float

	String str2="12.34F";

	Float number2=Float.valueOf(str2);
	System.out.println(number2);

		//double

	String str3="2336.55";

	Double number3=Double.valueOf(str3);

	System.out.println(number3);



		}

	}
